import React from 'react';
import './App.css';

class App extends React.Component {

  state = {
    numero1: '',
    numero2: '',
    resultado: ''
  }

  render() {
    return (
      <div>
        <label>Nome:</label>
        <input type="text" value={this.state.nome} onChange={(e) => this.setState({nome: e.target.value})} />
        <br/>
        {this.state.nome}
      </div>
    )
  }
}

export default App;
